import React from 'react'
import getStart from "../Assets/Images/getstart.svg"

const Button = ({ type, text, onClick }) => {        
    switch(type.toLowerCase()) {
        case "primary":
            return <button className="flex items-center bg-[#000000] px-[1.3rem] py-[0.5rem] font-[archivo-regular] text-[#FFFFFF] rounded-[2rem]" onClick={onClick}>{text}</button>
            break;
        case "default":
            return <button className="flex items-center bg-[#FFFFFF] px-[1.3rem] py-[0.5rem] font-[archivo-regular] text-[#000000] rounded-[2rem]" onClick={onClick}>{text} <img src="" alt="" /></button>
            break;

    }
}

export default Button
